import React from 'react'
import Item from './Item'

const Items = (props) => {
    

    return( 
    <ol>
        {props.todos.map((todo, i) => ( 
            <Item key={i} onDelete={() =>  props.onDelete(i)} onEdit={() =>  props.onEdit(i)}>
                {todo}
            </Item>
        ))}
    </ol>
    )
}

export default Items
